import api from './api';

export const contentService = {
  getContent: (pageName) => 
    api.get(`/content/${pageName}`),

  updateContent: (pageName, contentData) => 
    api.put(`/content/${pageName}`, { content: JSON.stringify(contentData) }),

  getPages: () => 
    api.get('/content/pages')
};
